    const handleClick =()=> {
        
        setIsTrue(!isTrue)
    }
    
    return (
        <div>   
            <h1 onClick={handleClick} style={isTrue? {backgroundColor: 'blue'} : back}>True or False ?</h1>
        </div>
    )
}

export default TestComponent
